import React from 'react'
import { Parallax, ParallaxProvider } from 'react-scroll-parallax';
import styled from 'styled-components';
import Parallaxie from '../Parallax/Parallax';

function Quality() {
    return(
        <QualitySection>
            <ParallaxProvider>

                <QualityContainer>
                    <Parallaxie src='../../images/h1-parallax-img-1.jpeg'/>

                    <BodyContainer>

                        <ContentHolder>
                            <Content>
                                <Title>Grow Your Capital</Title>
                                <Paragraph>
                                    Aliquam lorem ante, dapibus in, viverra quis, feugiat a, tellus. Phasellus viverra nulla ut metus varius laoreet. 
                                    Quisque rutrum. Aenean imperdiet. Etiam ultricies nisi vel augue. Curabitur ullamcorper ultricies nisi. Nam eget dui. 
                                    Etiam rhoncus. Maecenas tempus, tellus eget condimentum rhoncus, sem quam semper libero
                                </Paragraph>
                                <Button>WHITE PAPER</Button>
                            </Content>
                        </ContentHolder>

                        <ContentHolder>
                            <ContentFlex>
                                <ContentItem>
                                    <Image src='../../images/h1-custom-icon-img-12.png'/>
                                    <Percent>75%</Percent>
                                    <Ability>Security</Ability>
                                </ContentItem>
                            </ContentFlex>
                        </ContentHolder>
                    </BodyContainer>

                </QualityContainer>
            </ParallaxProvider>
        </QualitySection>
    );
}

const QualitySection = styled.section`
    max-height: 450px;
    overflow: hidden;
`

const QualityContainer = styled.div `
    position: relative;
`

const BodyContainer = styled.div`
    display: flex;
    flex-direction: row;

    position: absolute;
    top: 0;
    left: 0;
    right: 0;
`

const ContentHolder = styled.div`
    width: 50%;
`

const Content = styled.div`
    padding: 0 5%;
`

const Title = styled.div`
    font-size: 40px;
    font-family: sans-serif;
    color: #fff;
    font-weight: bold;
`

const Paragraph = styled.div`
    font-size: 14px;
    color: #fff;
    font-weight: 100;
    font-family: sans-serif;
    padding: 8% 20px 8% 0;
`

const Button = styled.div`
    border: 1.3px solid #fff;
    font-family: sans-serif;
    font-size: 15px;
    color: #fff;
    width: fit-content;
    padding: 10px 17px;
    border-radius: 20px;
`

const ContentFlex = styled.div`
    display: flex;
    flex-direction: row;
`

const ContentItem = styled.div`
    width: 33%;
`

const Image = styled.img``

const Percent = styled.div`
    color: #fff;
    font-size: 50px;
    font-family: sans-serif;
    line-height: 1;
`

const Ability = styled.div`
    font-size: 20px;
    font-family: sans-serif;
    font-weight: 100;
    color: #fff;
`


export default Quality;
